window.bookSummaryJSON = "<p>Charlie and the Misfits have been invited to join the closed beta of the new space-themed VRMMO, Star Nova Online.&nbsp;</p> <p>Together with hundreds of other test pilots, they hope to defend Earth from destruction.&nbsp;</p> <p>The Roth - a lizard-like warrior race - has nearly wiped humanity from the face of the universe and are on the way to finish the job.&nbsp;</p> <p>The test pilots have just seven days to train and prepare themselves.&nbsp;</p> <p>Soundbooth Theater reunites with Charlie, Remy, Monty and the Gun Meister gang in a brand new tutorial quest, preparing us all for Noah Barnettâ€™s series, Star Nova Online!&nbsp;</p> <p>Annie Ellicott brings another stellar performance, supported by Jeff Hays and Justin Thomas James as the male cast.&nbsp;</p> <p>The Soundbooth Theater Crew for this production:&nbsp;</p> <p></p> <ul> <li>Annie Ellicott - Narration</li> <li>Jeff Hays - Charlie, Tobias and other supporting characters</li> <li>Justin Thomas James - Monty, Spanky and the rest of the male cast</li> <li>Josh Kobak - Proofing</li> <li>Ahmed Mahmoud - Editing, Mastering, Sound Design and music</li> <li>Dalton Lynne - Project Manager</li> </ul>"; 
